import React, { Component } from 'react'
import Button from '@material-ui/core/Button';

class Test extends Component {
    render() {
        return (
            <div>
                <h1>Testing this component.</h1>
                <Button
              color="primary"
              variant="contained"
            >Continue</Button>
            </div>
        )
    }
}

export default Test
